import React from 'react';


function video () {
    return (
        <video className="video" autoPlay loop>
            <source src="video.mp4"></source>
        </video>
    )
}

function Grid () {
    return (
        <>
            <div className="grid">
                
            </div>
        </>
    )
}

let numbered = [];
let bombs = [];

for (let i = 0; i < 90; i++) {
    numbered[i] = Math.floor(Math.random() * 4);
}
for (let i = 0; i < 10; i++) {
    bombs[i] = 'pics.png';
    
}

const Data = numbered.concat(bombs);

const shuffleData = array => {
    for (let i = array.length; i > 0; i--) {
        const j = Math.floor(Math.random() * (i + 1));
        const temp = array[i];
        array[j] = temp;
    }
}

console.log(shuffleData(array));

export default video;
export {Grid};
